const initialState = {
    requirementsTable: []
}
const manageRequirementsReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'REQUIREMENTS_TABLE': {
            return {
                ...state,
                requirementsTable: action.data
            }
        }
        default: return state;
    }
}
export default manageRequirementsReducer;
